import { Api } from './api.js';

export class Datas {
	constructor(url, id) {
		this.option = '';
		this.fetchAllUserData = new Api(url, id);
		this.userDatas = [];
	}

	getUserDatas() {
		return this.fetchAllUserData.getUserDatas();
	}
}
